jQuery(document).ready(function($) {
    if (matchMedia) {
        const mq = window.matchMedia("(min-width: 848px)");
        mq.addListener(WidthChange);
        WidthChange(mq);
    }

    function WidthChange(mq) {
        if (mq.matches) {
			jQuery('.single-product .nasa-single-share').clone().appendTo('.single-product .woocommerce-product-details__short-description');
			jQuery('body').on('click', ".nasa-tab-filter-topbar", function() {
				jQuery(".nasa-top-sidebar-variations-active").removeClass("filtriazioninascosto");
			});
			 jQuery('body').on('click', ".cliccaback", function() {
				 jQuery(".nasa-top-sidebar-variations-active").addClass("filtriazioninascosto");
			});
            jQuery(".burger-menu").click(function() {
                if (jQuery(".burger-menu").hasClass("active")) {
                    jQuery("#mySidenav").css("left", "-50%");
                } else {
                    jQuery("#mySidenav").css("left", "0");
                }
            });
        } else {
			jQuery('.single-product .nasa-single-share').clone().appendTo('.single-product .woocommerce-product-details__short-description');	
			jQuery('#nasa-main-image-1').clone().appendTo('.fotocantinaprodotto');	
			jQuery('#nasa-main-image-2').clone().appendTo('.fotocantinaprodotto');
			jQuery('body').one('click', ".burger-menu", function() {
				jQuery('.nasa-icon-search').appendTo('#mySidenav');	
			});
			jQuery('body').on('click', ".nasa-tab-filter-topbar", function() {
				jQuery(".nasa-top-sidebar").addClass("sisidebarmobile");
			});
			 jQuery('body').on('click', ".cliccaback", function() {
				 jQuery(".nasa-top-sidebar").removeClass("sisidebarmobile");
			});
            jQuery(".burger-menu").click(function() {
                if (jQuery(".burger-menu").hasClass("active")) {
                    jQuery("#mySidenav").addClass('menumobileinattivo');
					jQuery("#mySidenav").removeClass('menumobileattivo');
                } else {
                    jQuery("#mySidenav").addClass('menumobileattivo');
					jQuery("#mySidenav").removeClass('menumobileinattivo');
                }
            });
        }
    }
});

